import React, {Component} from 'react';

class HomePage extends Component {

    constructor(props) {
        this.state = {
            projectName: '',
            investor: '',
            address: '',
            area: '',
            time: ''
        }
    };

    handleChange = (event) => {
        this.setState({
            projectName: event.target.projectName,
            investor: event.target.investor,
            address: event.target.address,
            area: event.target.area,
            time: event.target.time
        })
    };

    handleSubmit = (event) => {
        event.preventDefault()

    };

    render() {
        return (
            <div className="container mt-5">
                <form onSubmit={this.handleSubmit}>
                    <div className="form-group">
                        <label>Dự án</label>
                        <input type="text" className="form-control" value={this.state.projectName} onChange={this.handleChange}/>
                    </div>
                    <div className="form-group">
                        <label>Chủ đầu tư</label>
                        <input type="text" className="form-control" value={this.state.investor} onChange={this.handleChange}/>
                    </div>
                    <div className="form-group">
                        <label>Địa chỉ</label>
                        <input type="text" className="form-control" value={this.state.address} onChange={this.handleChange}/>
                    </div>
                    <div className="form-group">
                        <label>Diện tích</label>
                        <input type="text" className="form-control" value={this.state.area} onChange={this.handleChange}/>
                    </div>
                    <div className="form-group">
                        <label>Thời gian</label>
                        <input type="text" className="form-control" value={this.state.time} onChange={this.handleChange}/>
                    </div>
                    <button type="submit" className="btn btn-primary mt-2">Tạo dự án</button>
                </form>
            </div>
        );
    }
}

export default HomePage;
